  true,\n\t\"url\": null,\n\t\"notes\": \"Small table showing the total Civil Service
  Retirement System (CSRS) and Federal Employees Retirement System (FERS) Annuitants
  added to the Annuity Roll Processing System (ARPS) from Fiscal Year 2000 to the
  most recent fiscal year (posted within several months of the end of the fiscal year).
  Fiscal years run from the beginning of October to the end of September. Includes
  all Federal agencies (Executive, Legislative, Judicial branches, U.S. Postal Service,
  and Intelligence Agencies). ARPS is the system of record for all retirements. Monthly
  annuity payments are made through ARPS. The Enterprise Human Resources Integration-Statistical
  Data Mart (EHRI-SDM) provides other statistical information on Federal retirements.
  \ However, the data is limited to only the Executive branches of the Federal government.\",\n\t\"license_title\":
